import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Middlepage = () => {
    return (
        <View>
            <View>
                <Text>One Page</Text>
                <Text></Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({})

export default Middlepage;
